def compare_ele(tree, node1, node2):
shared_ancestors = get_shared_ancestors(tree, node1, node2)
shared_ex_branch, exclusive, parallel, shared_par_branch = 0
for ancestor in shared_ancestors:
if ancestor is "Condition":
shared_ex_branch += 1
elif ancestor is "Branch":
shared_par_branch += 1
elif ancestor is "exclusive choice":
exclusive += 1
elif ancestor is "parallel":
parallel += 1
if exclusive > shared_ex_branch:
return "node1 and node2 are on different exclusive branches"
elif parallel > shared_par_branch:
return "node1 and node2 are on different parallel branches"
for nodes in tree.iter():
if nodes == node1:
return "node1 is executed before node2"
elif nodes == node2:
return "node2 is executed before node1"
